package bubble;

option java_package = "com.qiyi.slide.resys.common";
option java_outer_classname="StarWallInfoProtos";

message StarWallInfo {
  optional int64 id = 1;
  optional string name = 2;
  optional string icon = 3;
  repeated int64 paopaos = 4;
  optional int64 star_id = 5;
  repeated int64 refine_videos = 6;
  optional int32 wall_type = 7;
}
